import MovieCard from "../Components/MovieCard/MovieCard";
import { movies } from "./../constants";

import "./../App.css";

export default function Home() {
  return (
    <div className="App">
      <span className="title">Recommended Movies</span>
      <section className="movie-container">
        {movies.map((movie)=> <MovieCard name={movie.name} href={movie.path} /> )}
        <MovieCard name="Hamlet" href="/movie-seat-1" />
        <MovieCard name="As You Like It" href="/movie-seat-2" />
        <MovieCard name="Othello" href="/movie-seat-3" />
      </section>
    </div>
  );
}
